import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './styles.css';

const Nav = () => {
  const [activeTab, setActiveTab] = useState(1);

  return (
    <div className="container">
      <div className="backgroundText">
        Some text with a black border around each letter
      </div>
      <div className="title">
        Oval Text
      </div>
      <Link to="/page1">
        <div className={`navOval ${activeTab === 1 ? 'active' : ''}`} onClick={() => setActiveTab(1)}>Tab 1</div>
      </Link>
      <Link to="/page2">
        <div className={`navOval ${activeTab === 2 ? 'active' : ''}`} onClick={() => setActiveTab(2)}>Tab 2</div>
      </Link>
      <Link to="/page3">
        <div className={`navOval ${activeTab === 3 ? 'active' : ''}`} onClick={() => setActiveTab(3)}>Tab 3</div>
      </Link>
      {activeTab === 1 && <div className="textBox">Content for Page 1</div>}
      {activeTab === 2 && <div className="textBox">Content for Page 2</div>}
      {activeTab === 3 && <div className="textBox">Content for Page 3</div>}
    </div>
  );
};

export default Nav;
